  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains those Missouri waters
  which have been assessed as impaired in 2014, including waters on Missouri's proposed
  2014 Section 303(d) List, but also including waters not on that list, such as waters
  which have a Total Maximum Daily Load (TMDL) or other appropriate management plan
  in place, or waters which are not impaired by a discrete pollutant. Missouri's proposed
  2014 303(d) List has not yet received approval from the Environmental Protection
  Agency (EPA). The data set contains the names of impaired waters, their unique identification
  numbers and locations, and identifies specific pollutants and pollutant sources
  if they are known. This data set is created in conjunction with the Missouri Water
  Quality Report, which is produced biennially as required by Section 305(b) of the
  Federal Clean Water Act, and correlates to Tables 14-15 of that report.\",\n\t\"license_title\":
